PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE gps_log (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            timestamp DATETIME,
            latitude REAL,
            longitude REAL,
            latitude_error REAL,
            longitude_error REAL,
            speed REAL,
            mode TEXT,
            measurement_iteration INTEGER,
            measurement_point INTEGER,
            comment TEXT
        );
DELETE FROM sqlite_sequence;
COMMIT;
